/*Table structure for table `flight` */

DROP TABLE IF EXISTS `flight`;

CREATE TABLE `flight` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) NOT NULL,
  `sub_title` varchar(255) DEFAULT NULL,
  `content` text,
  `detail` text,
  `img_url` varchar(255) DEFAULT NULL,
  `view_count` int(11) DEFAULT '0',
  `fav_count` int(11) DEFAULT '0',
  `comment_count` int(11) DEFAULT '0',
  `created_at` date NOT NULL,
  `updated_at` date NOT NULL,
  `Reg` varchar(50) DEFAULT NULL,
  `AirPort` int(11) DEFAULT '0',
  `Aircraft` int(11) DEFAULT '0',
  `Airline` int(11) DEFAULT '0',
  `Registration` varchar(50) DEFAULT NULL,
  `SerialNumber` varchar(50) DEFAULT NULL,
  `PhotoDate` date DEFAULT NULL,
  `Remarks` text,
  `Categories_photo` varchar(255) DEFAULT NULL,
  `Categories_aircraft` varchar(255) DEFAULT NULL,
  `Camera` int(11) DEFAULT '0',
  `Lens` int(11) DEFAULT '0',
  `EnterWhy` text,
  `Comments` text,
  `genre` varchar(20) DEFAULT NULL,
  `showExif` int(11) DEFAULT '0',
  `Photograper` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8;

